  \"FLEET for Unseeded Velocity Measurements in All Speed Regimes Project\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 5,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-06T22:26:08.274951\",\n\t\"name\": \"fleet-for-unseeded-velocity-measurements-in-all-speed-regimes-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"&lt;p&gt;FLEET uses a 100 fs laser to excite
  a multi-photon process that makes the gas (N2 or air) glow.&amp;nbsp; Images of
  the glowing gas taken at set time intervals allow the gas velocity to be measrued.&amp;nbsp;
  FLEET has the following advantageous features compared with existing measurement
  techniques: (1) it excites naturally-present N2 so it can be used in N2 or air flows
  - not requiring additional gas or particle seeding; (2) both excitation and detection
  are in the visible spectral range, so special UV or IR windows are not required;
  (3) only a single laser and camera is required which simplifies setup and operation;
  (4) the technique has been shown to work over a large range of pressures and is
  therefore amenable to a wide range of speed regimes (subsonic to hypersonic); and
  (5) the technique can easily be extended to measure thousands of samples per second.&amp;nbsp;
  The technique is thus applicable to a much wider range of wind tunnels than any
  other velocity measurement technique currently being developed at NASA.&amp;nbsp;
  For comparison, one currently state-of-the-art technique, NO2 molecular tagging
  velocimetry, requires three lasers, requires seeding the flow with toxic NO2 gas,
  requires expensive UV-grade fused silica windows on two sides of the wind tunnel
  and is limited to about 10 measurements per second.&lt;/p&gt;\",\n\t\"license_title\":
